INSERT INTO `notification_message_line` VALUES (100,NULL,'Dear $first_name $last_name,\n\n This is to notify you that your latest invoice (number $number) is now available. The total amount due is: $total. You can view it by login in to:\n\n\" + Util.getSysProp(\"url\") + \"/billing/user/login.jsp?entityId=$company_id\n\nFor security reasons, your statement is password protected.\nTo login in, you will need your user name: $username and your account password: $password\n \n After logging in, please click on the menu option  List, to see all your invoices.  You can also see your payment history, your current purchase orders, as well as update your payment information and submit online payments.\n\n\nThank you for choosing $company_name, we appreciate your business,\n\nBilling Department\n$company_name',0),(206,203,'Invoice remainder',1),(102,NULL,'Dear $first_name $last_name,\n\n  This email is to notify you that we have received your latest payment and your account no longer has an overdue balance.\n\n  Thank you for keeping your account up to date,\n\n\nBilling Department\n$company_name',0),(233,218,'Overdue Balance',1),(104,NULL,'Dear $first_name $last_name,\n\nOur records show that you have an overdue balance on your account. Please submit a payment as soon as possible.\n\nBest regards,\n\nBilling Department\n$company_name',0),(238,221,'It is time to update your credit card',1),(217,209,'Thank you for your payment',1),(107,NULL,'Dear $first_name $last_name,\n\nYour service with us will expire on $period_end. Please make sure to contact customer service for a renewal.\n\nRegards,\n\nBilling Department\n$company_name',0),(222,212,'Payment failed',1),(109,NULL,'Dear $first_name $last_name\n\n   We have received your payment made with $method for a total of $total.\n\n   Thank you, we appreciate your business,\n\nBilling Department\n$company_name',0),(228,215,'You account is now up to date',1),(111,NULL,'Dear $first_name $last_name\n\n   A payment with $method was attempted for a total of $total, but it has been rejected by the payment processor.\nYou can update your payment information and submit an online payment by login into :\n\" + Util.getSysProp(\"url\") + \"/billing/user/login.jsp?entityId=$company_id\n\nFor security reasons, your statement is password protected.\nTo login in, you will need your user name: $username and your account password: $password\n\nThank you,\n\nBilling Department\n$company_name',0),(112,NULL,'Dear $first_name $last_name\n\n   This is a reminder that the invoice number $number remains unpaid. It was sent to you on $date, and its total is $total. Although you still have $days days to pay it (its due date is $dueDate), we would greatly appreciate if you can pay it at your earliest convenience.\n\nYours truly,\n\nBilling Department\n$company_name',0),(212,206,'Your service from $company_name is about to expire',1),(244,225,'You password is $password.\r\n\r\nThank You,\r\n\r\nBilling Department\r\nTel: (404) 410-2700\r\n\r\n\"Cloud Telecommunications\"\r\n',1),(115,NULL,'Dear $first_name $last_name,\n\nWe want to remind you that the credit card that we have in our records for your account is about to expire. Its expiration date is $expiry_date.\n\nUpdating your credit card is easy. Just login into \" + Util.getSysProp(\"url\") + \"/billing/user/login.jsp?entityId=$company_id. using your user name: $username and password: $password. After logging in, click on \'Account\' and then \'Edit Credit Card\'. \nThank you for keeping your account up to date.\n\nBilling Department\n$company_name',0),(200,200,'Billing Statement from $company_name',1),(201,201,'Dear $first_name $last_name,\r\n\r\nNew Statement Available:\r\n\r\nAccount: $contact.organizationName\r\nTotal amount due: $total\r\n\r\nYou can view it by logging in to:\r\nhttps://ebill.digitalcompass.net\r\n\r\nAfter logging in, please click on the list menu option to see all your invoices.  You can also see your payment history, your current purchase orders, as well as update your payment information and submit online payments.\r\n\r\n\r\nThank You,\r\n\r\nBilling Department\r\nTel: (404) 410-2700\r\n\r\n\"Cloud Telecommunications\"',1),(202,202,'<html xmlns:v=\"urn:schemas-microsoft-com:vml\" xmlns:o=\"urn:schemas-microsoft-com:office:office\" xmlns:w=\"urn:schemas-microsoft-com:office:word\" xmlns:m=\"http://schemas.microsoft.com/office/2004/12/omml\" xmlns=\"http://www.w3.org/TR/REC-html40\"><head><META HTTP-EQUIV=\"Content-Type\" CONTENT=\"text/html; charset=us-ascii\"><meta name=Generator content=\"Microsoft Word 14 (filtered medium)\"><style><!--\r\n/* Font Definitions */\r\n@font-face\r\n	{font-family:\"Cambria Math\";\r\n	panose-1:2 4 5 3 5 4 6 3 2 4;}\r\n@font-face\r\n	{font-family:Calibri;\r\n	panose-1:2 15 5 2 2 2 4 3 2 4;}\r\n@font-face\r\n	{font-family:Tahoma;\r\n	panose-1:2 11 6 4 3 5 4 4 2 4;}\r\n/* Style Definitions */\r\np.MsoNormal, li.MsoNormal, div.MsoNormal\r\n	{margin:0in;\r\n	margin-bottom:.0001pt;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";}\r\na:link, span.MsoHyperlink\r\n	{mso-style-priority:99;\r\n	color:blue;\r\n	text-decoration:underline;}\r\na:visited, span.MsoHyperlinkFollowed\r\n	{mso-style-priority:99;\r\n	color:purple;\r\n	text-decoration:un',1),(203,202,'derline;}\r\np.MsoAcetate, li.MsoAcetate, div.MsoAcetate\r\n	{mso-style-priority:99;\r\n	mso-style-link:\"Balloon Text Char\";\r\n	margin:0in;\r\n	margin-bottom:.0001pt;\r\n	font-size:8.0pt;\r\n	font-family:\"Tahoma\",\"sans-serif\";}\r\nspan.EmailStyle17\r\n	{mso-style-type:personal-compose;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	color:windowtext;}\r\nspan.BalloonTextChar\r\n	{mso-style-name:\"Balloon Text Char\";\r\n	mso-style-priority:99;\r\n	mso-style-link:\"Balloon Text\";\r\n	font-family:\"Tahoma\",\"sans-serif\";}\r\n.MsoChpDefault\r\n	{mso-style-type:export-only;\r\n	font-family:\"Calibri\",\"sans-serif\";}\r\n@page WordSection1\r\n	{size:8.5in 11.0in;\r\n	margin:1.0in 1.0in 1.0in 1.0in;}\